stream = ''

blocks_sizes = [1, 2, 4, 8, 16, 32, 64, 128, 256, 512, 1024]
window_start = 0
window_end = 500
N = 500
current_timestamp = 0
blocks = [] # lista blokow, bloki to listy dwuelementowe - pierwszy element to znacznik czasowy, drugi - liczba jedynek w bloku


def get_blocks_by_size(size):
    return list(filter(lambda x: x[1] == size, blocks))


def create_new_block(size):
    blocks_by_size = get_blocks_by_size(size)
    new_block = [blocks_by_size[-2][0], size * 2]
    print('gets ' + str(blocks_by_size))
    print('returning ' + str([blocks_by_size[-3], new_block]))
    return [blocks_by_size[-3], new_block]


def check_blocks():
    new_blocks = []
    for i in blocks_sizes:
        all_blocks_with_current_size = get_blocks_by_size(i)
        if len(all_blocks_with_current_size) > 2:
            for el in create_new_block(i):
                new_blocks.insert(0, el)
        else:
            new_blocks.extend(all_blocks_with_current_size)

    return new_blocks


for bit in stream:
    # Sprawdzamy czy ostatni blok jest wciaz w zakresie okna N - jesli nie to go wyrzucamy
    if len(blocks):
        if blocks[0][0] < window_start % N:
            del blocks[0]

    # Jesli bit, ktory przyszedl == 1
    if bit == '1':
        # Dodaj nowy blok o wielkosci 1
        print('add element ' + str([current_timestamp % N, 1]))
        blocks.append([current_timestamp % N, 1])
        print(blocks)

        # Sprawdz wielkosc pozostalych blokow
        for i in blocks_sizes:
            blocks = check_blocks()


    current_timestamp += 1
    if current_timestamp > N:
        window_start += 1
        window_end += 1